import "./App.css";
import SidebarRestrictions from "./SidebarRestrictions";
import Restaurant from "./Restaurant";
import Menu from "./Menu";
import Item from "./Item";
import React from "react";

class App extends React.Component {
  addElements = (value) => {
    console.log(value);
  };

  renderRestaurants = () => {
    return (
      <Restaurant
        name={"McDonalds"}
        location={"2140 K Street Lincoln, NE 68510"}
        imageURL={"www.fakemcdonaldsimage.com"}
        websiteURL={"www.mcdonalds.com"}
        costLevel={"low"}
        foodCategory={"American"}
      />
    );
  };

  renderMenus() {
    return (
      <div className="App">
        <header className="App-header">
          <p>MenuMe</p>
        </header>

        <SidebarRestrictions
          expanded={"true"}
          addElementFunction={this.addElements}
        />

        {this.renderRestaurants}

        <Menu mealTime={"breakfast"} restaurant_id={1} />
      </div>
    );
  }

  renderItems = () => {
    return (
      <Item
        name={"Royale with Cheese"}
        description={"Quarter pounder with cheese"}
        menuId={1}
        cost={2.99}
        calories={550}
      />
    );
  };
}

export default App;
